import React, {useState} from 'react'

const axios = require('axios')
const center = {
  display: "grid",
  placeItems : "center",
  justifyConent: "center"
}
function Users() {
    var [users, setUsers] = useState([])
    
    var getUser = () => {
        axios.get('http://localhost:5000/api/dummy')
        .then( function(response) {
            console.log(response)
            setUsers(response.data);
            console.log(users)


           for(const ele of users) {
               console.log(ele.Name + " " + ele.ID  + " " + ele.Address)
           }


           
        })
        .catch(function (error) {
            console.log(error);
          })
    }
    var displayUser = () => {
        const items = <ol>
        {users.map(ele => (
          <li key={ele.Name}> {ele.Name} {ele.ID} {ele.Address}</li>
        ))}
      </ol>
      return items
    }
    return <div style = {center}>
    <button onClick = {getUser}>Get All Users</button>
    <div>{displayUser()}</div>
   
    </div>
}

export default Users
